START_TEST(test_heap_overflow_1) {
    int arr[] = { 0, 1 }, K = 2;
    int target = -1, ans = minKBitFlips(arr, LEN(arr), K);
    ck_assert_int_eq(ans, target);
}

START_TEST(test_heap_overflow_2) {
    int arr[] = { 1, 1, 0, 0, 1, 0, 1 }, K = 4;
    int target = -1, ans = minKBitFlips(arr, LEN(arr), K);
    ck_assert_int_eq(ans, target);
}

START_TEST(test_failed_1) {
    int arr[] = { 0, 0, 1, 1, 0, 0 }, K = 4;
    int target = 2, ans = minKBitFlips(arr, LEN(arr), K);
    ck_assert_int_eq(ans, target);
}

START_TEST(test_failed_2) {
    int arr[] = { 0, 0, 1 }, K = 2;
    int target = 1, ans = minKBitFlips(arr, LEN(arr), K);
    ck_assert_int_eq(ans, target);
}

void tcase_complete(TCase *t) {
    tcase_add_test(t, test_failed_1);
    tcase_add_test(t, test_failed_2);
    tcase_add_test(t, test_heap_overflow_1);
    tcase_add_test(t, test_heap_overflow_2);
    tcase_add_test(t, test_tle);
    tcase_add_test(t, test_official_1);
    tcase_add_test(t, test_official_2);
    tcase_add_test(t, test_official_3);

    set_execute_timeout(t, 0.1);
}
